import{_ as t,o as a,c as e,ag as i}from"./chunks/framework.Cma4Z3Bd.js";const p=JSON.parse('{"title":"dart.mirrors","description":"API documentation for the dart.mirrors library","frontmatter":{"title":"dart.mirrors","description":"API documentation for the dart.mirrors library","outline":[2,3],"editLink":false,"prev":false,"next":false},"headers":[],"relativePath":"api/dart-mirrors/index.md","filePath":"api/dart-mirrors/index.md","lastUpdated":null}'),o={name:"api/dart-mirrors/index.md"};function s(d,r,n,l,h,m){return a(),e("div",null,[...r[0]||(r[0]=[i('<h1 id="dart-mirrors" tabindex="-1">dart.mirrors <a class="header-anchor" href="#dart-mirrors" aria-label="Permalink to &quot;dart.mirrors&quot;">​</a></h1><p>Basic reflection in Dart, with support for introspection and dynamic invocation.</p><p><em>Introspection</em> is that subset of reflection by which a running program can examine its own structure. For example, a function that prints out the names of all the members of an arbitrary object.</p><p><em>Dynamic invocation</em> refers the ability to evaluate code that has not been literally specified at compile time, such as calling a method whose name is provided as an argument (because it is looked up in a database, or provided interactively by the user).</p><h2 id="how-to-interpret-this-librarys-documentation" tabindex="-1">How to interpret this library&#39;s documentation <a class="header-anchor" href="#how-to-interpret-this-librarys-documentation" aria-label="Permalink to &quot;How to interpret this library&#39;s documentation {#how-to-interpret-this-librarys-documentation}&quot;">​</a></h2><p>As a rule, the names of Dart declarations are represented using instances of class <a href="/dart-sdk-api/api/Dart_dart-core/Symbol.html">Symbol</a>. Whenever the doc speaks of an object <em>s</em> of class <a href="/dart-sdk-api/api/Dart_dart-core/Symbol.html">Symbol</a> denoting a name, it means the string that was used to construct <em>s</em>.</p><p>The documentation frequently abuses notation with Dart pseudo-code such as <code>o.x(a)</code>, where o and a are defined to be objects; what is actually meant in these cases is <code>o&#39;.x(a&#39;)</code> where <em>o&#39;</em> and <em>a&#39;</em> are Dart variables bound to <em>o</em> and <em>a</em> respectively. Furthermore, <em>o&#39;</em> and <em>a&#39;</em> are assumed to be fresh variables (meaning that they are distinct from any other variables in the program).</p><p>Sometimes the documentation refers to <em>serializable</em> objects. An object is serializable across isolates if and only if it is an instance of num, bool, String, a list of objects that are serializable across isolates, or a map with keys and values that are all serializable across isolates.</p><h2 id="status-unstable" tabindex="-1">Status: Unstable <a class="header-anchor" href="#status-unstable" aria-label="Permalink to &quot;Status: Unstable {#status-unstable}&quot;">​</a></h2><p>The dart:mirrors library is unstable and its API might change slightly as a result of user feedback. This library is only supported by the Dart VM and only available on some platforms.</p><h2 id="section-classes" tabindex="-1">Classes <a class="header-anchor" href="#section-classes" aria-label="Permalink to &quot;Classes {#section-classes}&quot;">​</a></h2><table tabindex="0"><thead><tr><th>Class</th><th>Description</th></tr></thead><tbody><tr><td><a href="/dart-sdk-api/api/dart-mirrors/ClassMirror.html">ClassMirror</a></td><td>A <a href="/dart-sdk-api/api/dart-mirrors/ClassMirror.html">ClassMirror</a> reflects a Dart language class.</td></tr><tr><td><a href="/dart-sdk-api/api/dart-mirrors/ClosureMirror.html">ClosureMirror</a></td><td>A <a href="/dart-sdk-api/api/dart-mirrors/ClosureMirror.html">ClosureMirror</a> reflects a closure.</td></tr><tr><td><a href="/dart-sdk-api/api/dart-mirrors/CombinatorMirror.html">CombinatorMirror</a></td><td>A mirror on a show/hide combinator declared on a library dependency.</td></tr><tr><td><a href="/dart-sdk-api/api/dart-mirrors/DeclarationMirror.html">DeclarationMirror</a></td><td>A <a href="/dart-sdk-api/api/dart-mirrors/DeclarationMirror.html">DeclarationMirror</a> reflects some entity declared in a Dart program.</td></tr><tr><td><a href="/dart-sdk-api/api/dart-mirrors/FunctionTypeMirror.html">FunctionTypeMirror</a></td><td>A <a href="/dart-sdk-api/api/dart-mirrors/FunctionTypeMirror.html">FunctionTypeMirror</a> represents the type of a function in the Dart language.</td></tr><tr><td><a href="/dart-sdk-api/api/dart-mirrors/InstanceMirror.html">InstanceMirror</a></td><td>An <a href="/dart-sdk-api/api/dart-mirrors/InstanceMirror.html">InstanceMirror</a> reflects an instance of a Dart language object.</td></tr><tr><td><a href="/dart-sdk-api/api/dart-mirrors/IsolateMirror.html">IsolateMirror</a></td><td>An <a href="/dart-sdk-api/api/dart-mirrors/IsolateMirror.html">IsolateMirror</a> reflects an isolate.</td></tr><tr><td><a href="/dart-sdk-api/api/dart-mirrors/LibraryDependencyMirror.html">LibraryDependencyMirror</a></td><td>A mirror on an import or export declaration.</td></tr><tr><td><a href="/dart-sdk-api/api/dart-mirrors/LibraryMirror.html">LibraryMirror</a></td><td>A <a href="/dart-sdk-api/api/dart-mirrors/LibraryMirror.html">LibraryMirror</a> reflects a Dart language library, providing access to the variables, functions, and classes of the library.</td></tr><tr><td><a href="/dart-sdk-api/api/dart-mirrors/MethodMirror.html">MethodMirror</a></td><td>A <a href="/dart-sdk-api/api/dart-mirrors/MethodMirror.html">MethodMirror</a> reflects a Dart language function, method, constructor, getter, or setter.</td></tr><tr><td><a href="/dart-sdk-api/api/dart-mirrors/Mirror.html">Mirror</a></td><td>A <a href="/dart-sdk-api/api/dart-mirrors/Mirror.html">Mirror</a> reflects some Dart language entity.</td></tr><tr><td><a href="/dart-sdk-api/api/dart-mirrors/MirrorSystem.html">MirrorSystem</a></td><td>A <a href="/dart-sdk-api/api/dart-mirrors/MirrorSystem.html">MirrorSystem</a> is the main interface used to reflect on a set of associated libraries.</td></tr><tr><td><a href="/dart-sdk-api/api/dart-mirrors/ObjectMirror.html">ObjectMirror</a></td><td>An <a href="/dart-sdk-api/api/dart-mirrors/ObjectMirror.html">ObjectMirror</a> is a common superinterface of <a href="/dart-sdk-api/api/dart-mirrors/InstanceMirror.html">InstanceMirror</a>, <a href="/dart-sdk-api/api/dart-mirrors/ClassMirror.html">ClassMirror</a>, and <a href="/dart-sdk-api/api/dart-mirrors/LibraryMirror.html">LibraryMirror</a> that represents their shared functionality.</td></tr><tr><td><a href="/dart-sdk-api/api/dart-mirrors/ParameterMirror.html">ParameterMirror</a></td><td>A <a href="/dart-sdk-api/api/dart-mirrors/ParameterMirror.html">ParameterMirror</a> reflects a Dart formal parameter declaration.</td></tr><tr><td><a href="/dart-sdk-api/api/dart-mirrors/SourceLocation.html">SourceLocation</a></td><td>A <a href="/dart-sdk-api/api/dart-mirrors/SourceLocation.html">SourceLocation</a> describes the span of an entity in Dart source code.</td></tr><tr><td><a href="/dart-sdk-api/api/dart-mirrors/TypedefMirror.html">TypedefMirror</a></td><td>A <a href="/dart-sdk-api/api/dart-mirrors/TypedefMirror.html">TypedefMirror</a> represents a typedef in a Dart language program.</td></tr><tr><td><a href="/dart-sdk-api/api/dart-mirrors/TypeMirror.html">TypeMirror</a></td><td>A <a href="/dart-sdk-api/api/dart-mirrors/TypeMirror.html">TypeMirror</a> reflects a Dart language class, typedef, function type or type variable.</td></tr><tr><td><a href="/dart-sdk-api/api/dart-mirrors/TypeVariableMirror.html">TypeVariableMirror</a></td><td>A <a href="/dart-sdk-api/api/dart-mirrors/TypeVariableMirror.html">TypeVariableMirror</a> represents a type parameter of a generic type.</td></tr><tr><td><a href="/dart-sdk-api/api/dart-mirrors/VariableMirror.html">VariableMirror</a></td><td>A <a href="/dart-sdk-api/api/dart-mirrors/VariableMirror.html">VariableMirror</a> reflects a Dart language variable declaration.</td></tr></tbody></table><h2 id="section-exceptions" tabindex="-1">Exceptions <a class="header-anchor" href="#section-exceptions" aria-label="Permalink to &quot;Exceptions {#section-exceptions}&quot;">​</a></h2><table tabindex="0"><thead><tr><th>Exception</th><th>Description</th></tr></thead><tbody><tr><td><a href="/dart-sdk-api/api/dart-mirrors/AbstractClassInstantiationError.html">AbstractClassInstantiationError</a></td><td>Error thrown when trying to instantiate an abstract class.</td></tr></tbody></table><h2 id="section-functions" tabindex="-1">Functions <a class="header-anchor" href="#section-functions" aria-label="Permalink to &quot;Functions {#section-functions}&quot;">​</a></h2><table tabindex="0"><thead><tr><th>Function</th><th>Description</th></tr></thead><tbody><tr><td><a href="/dart-sdk-api/api/dart-mirrors/currentMirrorSystem.html">currentMirrorSystem</a></td><td>Returns a <a href="/dart-sdk-api/api/dart-mirrors/MirrorSystem.html">MirrorSystem</a> for the current isolate.</td></tr><tr><td><a href="/dart-sdk-api/api/dart-mirrors/reflect.html">reflect</a></td><td>Reflects an instance.</td></tr><tr><td><a href="/dart-sdk-api/api/dart-mirrors/reflectClass.html">reflectClass</a></td><td>Reflects a class declaration.</td></tr><tr><td><a href="/dart-sdk-api/api/dart-mirrors/reflectType.html">reflectType</a></td><td>Reflects the type represented by <code>key</code>.</td></tr></tbody></table>',16)])])}const f=t(o,[["render",s]]);export{p as __pageData,f as default};
